function pdf_ring_cards(ringCardDetails, showName, showDates, fileName) {

	page = 0;
	ddRingCard.content = [];
	
	for ( var ring_no in ringCardDetails) {
		var details = ringCardDetails[ring_no];
		ddRingCard.content.push(header(showName, showDates, ring_no, details['handler'], details['dog_name'], details['dog_level'], details['dog_height'], details['lho']),
				classTable(details['classes']), footer(), miscInfo(details['misc1'], details['misc2']));
		
		if (page === 0 && details['camping'] !== ''){
			ddRingCard.content.push(camping(details['camping']));
		}
		
		if (page === (Object.keys(ringCardDetails).length - 1)) {
			ddRingCard.content.push({
				text : '',
				style : 'small'
			});
		} else {
			ddRingCard.content.push({
				text : '',
				style : 'small',
				pageBreak : 'after'
			});
		}
		page++;
	}
	pdfMake.createPdf(ddRingCard).download(fileName);

}

function header(showName, showDates, ringNo, handler, dogName, dogLevel, dogHeight, lho) {
	if (lho !== 'undefined' && lho !== ''){ lho = 'LHO: '+lho; }
	return {
		table : {
			widths : [ '*', 'auto' ],
			body : [ [ {
				text : showName,
				style : 'h1'
			}, {
				text : [ 'Ring Number: ', {
					text : ringNo,
					fontSize : 15,
					bold : true
				} ],
				alignment : 'right',
				rowSpan : 2
			} ], [ {
				text : showDates,
				style : 'h2'
			}, ], [{
				colSpan : 2,
				alignment : 'right',
				text : handler,
				style : 'h2'
			} ], [  {
				text : lho,
				style : 'h2'
			}, {
				//colSpan : 2,
				alignment : 'right',
				style : 'h2',
				text : dogName + " - " + dogHeight + " - " + dogLevel
			} ] ]
		},
		layout : {
			hLineWidth : function(line) {
				return line === 4
			},
			vLineWidth : function() {
				return 0;
			},
			paddingBottom : function() {
				return 5;
			}
		}
	};
}

function classTable(dogClasses) {

	var body = [];
	headerRow = [];
	headerRow.push("", {
		text : "Class",
		colSpan : 2,
		style : 'tableHeader'
	}, "", {
		text : "R/O",
		style : 'tableHeader',
		alignment : 'center'
	}, {
		text : "(=to)",
		style : 'tableHeader',
		alignment : 'center'
	}, {
		text : "(entry)",
		style : 'tableHeader',
		alignment : 'center'
	}, {
		text : "Ring",
		style : 'tableHeader',
		alignment : 'center',
		colSpan : 2
	}, "");
	body.push(headerRow);

	for (date in dogClasses) {
		var dataRow = [];
		dataRow.push({
			text : date,
			colSpan : 8
		});
		body.push(dataRow);
		for (i = 0; i < dogClasses[date].length; i++) {
			classData = dogClasses[date][i];
			cells = [];
			cells.push("");
			cells.push({
				text : classData['class_no'],
				alignment : 'right'
			});
			cells.push(classData['class_title']);
			cells.push({
				text : classData['running_order'],
				alignment : 'center'
			});
			cells.push({
				text : classData['equalto'],
				alignment : 'center'
			});
			cells.push({
				text : classData['total_entry'],
				alignment : 'center'
			});
			cells.push({
				text : classData['which_ring'],
				alignment : 'right'
			});
			cells.push({
				text : classData['onfirst'],
				alignment : 'left'
			});
			body.push(cells);
		}
	}

	return {
		table : {
			widths : [ 20, 20, '*', 50, 50, 50, 30, 20 ],
			headerRows : 1,
			body : body
		},
		layout : 'noBorders',
		margin : [ 0, 5, 0, 5 ]
	};
}

function footer() {
	return {
		table : {
			widths : [ '50%', '50%' ],
			body : [ [ {
				image : 'aaLogo',
				fit : [ 80, 80 ]
			}, {
				alignment : 'right',
				stack : [ {
					text : "* = first class in the ring",
					style : 'h2',
				}, {
					text : 'www.agilityaid.co.uk',
					style : 'hyperlink',
					alignment : 'right'
				} ]
			} ] ]
		},
		layout : {
			hLineWidth : function(line) {
				return line === 0
			},
			vLineWidth : function() {
				return 0;
			},
			paddingTop : function() {
				return 5;
			}
		}
	};
}

function camping(camping) {
	return {
		text : [
			{text: camping, style: 'strong', alignment: 'center'}		
		],
		margin : [ 0, 5, 0, 5 ]
	};
}

function miscInfo(misc1, misc2) {
	return {
		text : [
			{text: misc1, style: 'small', alignment: 'center'},
			{text: misc2, style: 'small', alignment: 'center'}			
		],
		margin : [ 0, 5, 0, 5 ]
	};
}

